import { createSlice } from '@reduxjs/toolkit';
import * as actionType from '../constants/actionType.js';

const initialState = {
    image: null
}

const comfySlice = createSlice({
    name: 'posts',
    initialState: initialState,
    reducers: {},
    extraReducers: (builder) => {
        builder
            .addCase(`${'NO_LOGIN'}`, () => { return { ...initialState, isLoading: false }; })
            .addCase(`${actionType.RESET_STATE}`, () => initialState)
    },
});

export default comfySlice.reducer;
